						writer.sb.Append(':');
						if(applyDicV!=null)
						{
							applyDicV.writeDataString(writer);
						}
						else
						{
							writer.sb.Append("ApplyAddFriendData=null");
						}
						
						writer.writeEnter();
					}
				}
			}
			writer.writeRightBrace();
		}
		else
		{
			writer.sb.Append("=null");
		}
		
		writer.writeEnter();
	}
	
	/// <summary>
	/// 初始化初值
	/// </summary>
	public override void initDefault()
	{
		this.friends=new LongObjectMap<FriendData>();
		this.blackList=new LongObjectMap<ContactData>();
		this.applyDic=new LongObjectMap<ApplyAddFriendData>();
	}
	
	/// <summary>
	/// 回池
	/// </summary>
	protected override void toRelease(DataPool pool)
	{
		this.friends=null;
		this.blackList=null;
		this.applyDic=null;
	}
	
}
